                distance = abs(elem - elem2)
                closest_pair = tuple(sorted([elem, elem2]))
            else:
                new_distance = abs(elem - elem2)
                if new_distance < distance:
                    distance = new_distance
                    closest_pair = tuple(sorted([elem, elem2]))

